script: |
  super -f text -I q9281.spq | sort > q9281.out

inputs:
  - name: q9281.spq
    data: |
      SELECT DISTINCT - - col0 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN - col2 AND + col0 + + col2 * + col2 + + col0 * + col0 * - col1 + - col0 * - col2 * + 54;
  - name: tab2

outputs:
  - name: q9281.out
    data: |
